import React, {Component} from 'react';

class Home extends Component {
    constructor(props) {
        super(props);
        this.state={
            login : false,
            optinurl : ""
        }

    }
    componentDidMount() {
        axios({
            method: 'get',
            url: 'http://localhost:8081/adres/all',
        }).then((response) => {
            this.setState({adres: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });
    }

    render() {
        if (this.props.login)
        return (
            <div className="data-in-page">
                Home
            </div>
        );
        else
            return (
                <div className="data-in-page"> Login error</div>);
    }
}

export default Home;
